export class Person {
    name;
    city;
    constructor(name, city) {
        this.name = name;
        this.city = city;
    }
}
export class Product {
    name;
    price;
    constructor(name, price) {
        this.name = name;
        this.price = price;
    }
}
export class City {
    name;
    pupulation;
    constructor(name, pupulation) {
        this.name = name;
        this.pupulation = pupulation;
    }
}
export class Employee {
    name;
    role;
    constructor(name, role) {
        this.name = name;
        this.role = role;
    }
}
